import './App.css';
import { useState , createContext } from 'react';
import { BrowserRouter as Router, Routes, Route, Link } from 'react-router-dom';

function App() {


  return (
    <div className='App'>
      <Router>
        <Routes>
          <Route path="/" element="Home.js"/>
          <Route />
          <Route />
        </Routes>
      </Router>
    </div>
  );
};


export default App;
